import React from 'react';


function Project(props) {
  return (
    <div className="card">
      <img src={props.imageSrc} className="card-img-top img-fluid" alt={props.title} />
      <div className="card-body">
        <h5 className="card-title">{props.title}</h5>
        <p className="card-text">Description of the project goes here.</p>
        <a href={props.deployedLink} className="btn btn-primary" target="_blank" rel="noopener noreferrer">View Project</a>
        <a href={props.githubLink} className="btn btn-secondary" target="_blank" rel="noopener noreferrer">GitHub Repo</a>
      </div>
    </div>
  );
}



export default Project;
